import React from 'react';
import doctor from '../../assets/images/doctor.png'


const MakeAppointment = () => {
    return (
        <section className='flex justify-center items-center'>
            <div>
                  <img src={doctor} alt=''/>
            </div>
            <div>
                  <h3 className='text-xl text-primary'>Appoinment</h3>
                  <h3 className='text-xl text-primary'>Make an Appoinment Today</h3>
                  <p className=''>doctor appointment and I did not have a doctor appointment or had to have my appointment scheduled on an appointment day. With the way our school was set up, our student health and safety was taken very seriously, and there was no fear for my safety. All this on the spot. In spite of all the warnings coming in the direction of the administration, I continued to receive schoolwork and had to take care of my own. My life, my school work, my business, and life itself were at risk. In a word, our life was at risk.</p>

            </div>
        </section>
    );
};

export default MakeAppointment;
